- input: "TEXT\x1CC00004606\x1C.TEXT\x1C\x1CF3XA\x1CTo: Alexandra Broomhead: Per your
    letter of February 21, 2013, regarding our entry on Schedule B supporting Line
    30(b) of the Detailed Summary Page for $13,978.88 in disbursements for \"Yard
    Sign printing\" on behalf of Mitt Romney, we provide this detail to support our
    contention that this disbusement is not a contribution to the Romney campaign,
    referencing 11CFR 100.87: The expenditure was for the printing of yard signs per
    the design we submitted to the vendor for the packaged yard signs and wire frames.
    There was no general public comunication or political advertising. The yard signs
    indicated they were paid for by the Kansas Republican Party. The entire disbursement
    was paid from contributions subject to the limitations and prohibitions of the
    Federal Election Campaign Act. There were no 'earmarked' funds expended, i.e.,
    that had been specified for use to support the Romney campaign or for the purchase
    of these yard signs from any donor, candidate, or committee. No funds received
    from the National Republican Committee were used to purchase the signs. The Kansas
    Republican Party staff made the final decision regarding the expenditure. The
    yard signs were picked-up at the print facility, moved, and distributed  by unpaid
    volunteers--no food or transportation costs were reimbursed. No commercial organization
    had any role other than printing the signs. T.C. Anderson\n"
